import React from 'react'

import './App.css';

import {Box, Button,} from '@mui/material'

const button1Style = {
  backgroundColor: "grey",
}

const button2Style = {
  backgroundColor: "lime",
}

const App = () => {
  const [value, setValue] = React.useState();
  const onChangeValue = React.useCallback((event) => {
    setValue(event.target.value)
  }, [])

  React.useEffect(() => console.log(value), [value])
  return (
    <div className="App">
      <Box display="flex" justifyContent="center" alignItems="center"  mt={10}>
        <Box display="flex" mr={1}>
          <Button variant="contained" style={button1Style}>
          use SHA256
          </Button>
        </Box>
        <Box display="flex" ml={1}>
          <Button variant="contained" style={button2Style}>
          use STREEBOG
          </Button>
        </Box>
      </Box>
      <input value={value} onChange={onChangeValue} style={{width: '20%'}}></input>
    </div>
  );
}

export default App;
